def deleteFile(file):
    """dltFl(file):删除指定文件或目录"""
    import os
    if os.path.isfile(file):
          os.remove(file)
          print('File deleted!')
    elif os.path.isdir(file):
          os.rmdir(file)
          print('Dir deleted!')
    else:
          print('The file or dir doesn\'t exist in the dir.')

